import React from 'react';
import {MapContainer, TileLayer, Marker, Popup, Circle, GeoJSON} from 'react-leaflet';
import {get} from 'http';

export default class MyMap extends React.Component {
    render(){
        const data = fetch('https://data.osmbuildings.org/0.2/anonymous/tile/15/68/28.json')
            .then(
                res => console.log(res)
            );

        return <MapContainer center={[64.128701,-21.942068]} zoom={15} scrollWheelZoom={true}>
        <TileLayer
            attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
            url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
        />
            <Marker position={[64.128701,-21.942068]}>
                <Popup>
                    Reykjavíkurflugvöllur
                </Popup>
            </Marker>
            <Circle center={[64.128701,-21.942068]} radius={900}>
                <Popup>
                    Reykjavíkurflugvöllur&apos;s region
                </Popup>
            </Circle>
        <GeoJSON

            url='https://{s}.data.osmbuildings.org/0.2/anonymous/tile/{z}/{x}/{y}.json'
        />
        </MapContainer>
    }
}
